const Input = ({ type, icon, iconType, placeholder, mt, mb }) => {
  return (
    <div
      className="input"
      style={{ marginTop: `${mt}px`, marginBottom: `${mb}px` }}
    >
      {iconType === "button" ? (
        <button type="submit">
          <img src={icon} alt={placeholder} />
        </button>
      ) : (
        <img src={icon} alt={placeholder} />
      )}
      <input type={type} placeholder={placeholder} />
    </div>
  );
};

export default Input;
